import React from 'react';
import App from './App';

class Profile extends App {
    constructor(){
            const user = App.user;
            //this.renderRepos() = App.renderRepos();
    return (
        <div>
            <div className="row">
                <div className="col-md-4">
                    <div className="card" style={{width: "18rem"}}>
                        <img className="card-img-top" alt="Profile" src={user.avatar_url}/>
                        <ul className="list-group list-group-flush">
                            <li className="list-group-item">
                                Repositórios: 
                                <span className="badge badge-primary">{user.public_repos}</span>
                            </li>
                            <li className="list-group-item">
                                Seguidores: 
                                <span className="badge badge-secondary">{user.followers}</span>
                            </li>
                        </ul>
                        <div className="card-body">
                            <button
                                type="button"
                                onClick={() => console.log("alo")}
                                className="btn btn-primary btn-block">
                                    Repositórios
                            </button>
                            <a href="user.html_url" className="btn btn-secondary btn-block">
                                Repositórios mais vistos
                            </a>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
    };
};

export default Profile;
